import React from 'react';
import { Routes, Route, Navigate, Link, useNavigate, useLocation } from 'react-router-dom';
import Login from './pages/Login';
import PrivateRoute from './components/PrivateRoute';
import AdminRoute from './components/AdminRoute';
import SellerRoute from './components/SellerRoute';
import DashboardHome from './pages/DashboardHome';
import SalesPage from './pages/SalesPage';
import AdminCadastros from './pages/AdminCadastros';
import { setToken, getUserInfo, setUserInfo } from './api';
import 'bootstrap/dist/css/bootstrap.min.css';
import './theme.css';

function AppHeader(){
  return (
    <header className="app-header border-bottom">
      <div className="container d-flex align-items-center py-3 position-relative">
        <div className="me-3">
          <img src="/logo.png" alt="AJ7" style={{height: 40, width: 'auto'}} />
        </div>
        <h1 className="app-title m-0 text-center w-100">Controle de Vendas e Comissões</h1>
      </div>
    </header>
  );
}

function AppNav(){
  const nav = useNavigate();
  const user = getUserInfo();
  const isAdmin = user?.role === 'admin';
  const isLogged = !!localStorage.getItem('token_v2');

  function logout(){
    setToken(null);
    setUserInfo(null);
    nav('/login');
  }

  return (
    <div className="border-bottom" style={{background: '#fff'}}>
      <nav className="container nav app-subnav align-items-center">
        <Link className="nav-link" to="/app">Dashboard</Link>
        {!isAdmin && <Link className="nav-link" to="/sales">Vendas</Link>}
        {isAdmin && <Link className="nav-link" to="/cadastro">Cadastro</Link>}
        <div className="ms-auto">
          {isLogged && <button className="btn btn-sm btn-primary" onClick={logout}>Sair</button>}
        </div>
      </nav>
    </div>
  );
}

export default function App(){
  const location = useLocation();
  const isLogin = location.pathname === '/login';

  return (
    <div className="d-flex flex-column min-vh-100">
      {/* Login não exibe header/nav */}
      {!isLogin && <AppHeader />}
      {!isLogin && <AppNav />}

      <div className={!isLogin ? 'container py-4 flex-grow-1' : 'flex-grow-1'}>
        <Routes>
          <Route path="/login" element={<Login/>} />
          <Route path="/app" element={<PrivateRoute><DashboardHome/></PrivateRoute>} />
          <Route path="/sales" element={<SellerRoute><SalesPage/></SellerRoute>} />
          <Route path="/cadastro" element={<AdminRoute><AdminCadastros/></AdminRoute>} />
          <Route path="*" element={<Navigate to="/app" replace />} />
        </Routes>
      </div>

      {!isLogin && (
        <footer className="bg-light text-center py-3 border-top">
          <small>© Daniel Correa</small>
        </footer>
      )}
    </div>
  );
}
